import styles from './input.module.css';

function Input({ type, text, name, value, onChange, onBlur, ...rest }) {
  return (
    <div className={styles.form_control}>
      <label htmlFor={name}>{text}:</label>
      <input
        type={type}
        id={name}
        name={name}
        value={value}
        onChange={onChange}
        onBlur={onBlur}
        {...rest}  
      />
    </div>
  );
}

export default Input;
